import { useState } from 'react';
import { Modal } from 'react-bootstrap';
function TransactionCard({props}){
        const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
        return(
                <>
                <tr>
                <th scope="row">1</th>
                <td>{props.fullName}</td>
                <td>{props.trip.tittle}</td>
                <td>{props.attachment}</td>
                <td>{props.status}</td>
                <td><img onClick={handleShow} src={require('./components/assets/Vector.png').default} /></td>
                </tr>
                
        <modal style={{width:1035,height:493}} show={show} onHide={handleClose}>
            <form>
                <img src={require("./components/assets/Icon.png").default}></img>
            </form>
    </modal>
                </>
        )
}
export default TransactionCard
